/*ep dynamic sql: 
   select ',(select responselabel from firstcontact_res '||labelnumber||' where '||labelnumber||'.surveylabelnumber='||''''||labelnumber||''''||' and fc.studentid='||labelnumber||'.studentid limit 1 )'||' "'||labelnumber||'"' 
