   select labelnumber,row_number() over(order by labelnumber),label from surveylabel  order by labelnumber; --label document
*/
-- Note if you do not see the result from this script, Run below two lines first(create index) separately one after other and remove line 2,3 from this script and run again.
CREATE INDEX IF NOT EXISTS idx1_firstcontact ON firstcontact (studentid);                           --create index 
